package spock.learning.picker

import spock.Picker.{Guessed, NotGuessed}
import spock._
import spock.learning.picker.GuesserHypothesis.Observation

case class ProfiledGuesserHypothesis(profile: ProfiledGuesserHypothesis.Profile)
  extends GuesserHypothesis {

  override val expectedScores =
    ExpectedScores((MinValue to MaxValue).map(value => profile(value).average).toVector)

  override def probGiven(observation: Observation): Double =
    profile(observation.pick).probGiven(observation.result)
}

object ProfiledGuesserHypothesis {
  type Profile = Map[Int, ProfiledGuesserHypothesis.FeedbackDistro]

  case class FeedbackDistro(probs: Map[Picker.Feedback, Double]) {
    require(probs.values.forall(_ >= 0) && (probs.values.sum - 1).abs <= Eps)

    val average: Double = probs.map { case (feedback, prob) => feedback.pickerScore * prob }.sum

    def probGiven(result: Picker.Feedback): Double = probs.getOrElse(result, 0)
  }

